export class TodayScoreModel {
	constructor(data) {
		this.id = data.userId;
		this.score = data.data.todayScore;
	}

	getTodayScore() {
		let data = {
			name: 'Score',
			score: this.score,
			fill: '#FF0000',
		};
		return data;
	}
}
